import React from "react";
import { Link, Routes, Route } from "react-router-dom";
import "./NavBar.css";

const NavBar = () => {
  return (
    <div class="navbar">
      <link href="#landingPage">SantaIsSanta</link>
      <div class="dropdown">
        <button class="dropbtn">
          지역별
          <i class="fa fa-caret-down"></i>
        </button>
        <div class="dropdown-content">
          <a href="#">수도권</a>
          <a href="#">강원도</a>
          <a href="#">경상도</a>
          <a href="#">전라도</a>
          <a href="#">충청도</a>
          <a href="#">제주도</a>
        </div>
      </div>
    </div>
  );
};

export default NavBar;
